import React from "react";
import { NavLink } from "react-router-dom";
import "../styles/MenuItem.scss";

const MenuItem = ({
  to,
  exact = false,
  handleClick = () => undefined,
  children,
}) => {
  return (
    <NavLink
      className="menu-item"
      type="button"
      to={to}
      exact={exact}
      onClick={() => handleClick(false)}
    >
      {children}
    </NavLink>
  );
};

export default MenuItem;
